import React from "react";
import "./Home.css";

export default function Home()
{
    return(
            <div className="App container">
              <Navbar fluid collapseOnSelect>
                <Navbar.Header>
                  <Navbar.Brand>
                    <Link to="/">Scratch</Link>
                  </Navbar.Brand>
                  <Navbar.Toggle/>
                </Navbar.Header>  
              </Navbar>
              <Route />
        
            </div>
          );
}
